  return (
    <>
      <div className="container-fluid">
        <div className="row bg-light">
          <div className="col-md-12">
            <h1 className="p-2 m-2 display-5">Welcome to BlogBooth</h1>

            {/* ===================Form==================== */}
            <form>
              <div className="col-md-8 mx-auto">
                <h3>Contact Us</h3>
                <div className=" ">
                  <div className=" ">
                    <div className=" "></div>
                  </div>
                </div>
              </div>
            </form>
          </div>
        </div>
      </div>
    </>
  );
};

export default Contact;
